import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './Components/Header';
import Navigation from './Components/Navigation';

import ProductAPI from './Components/ProductAPI'; // Hoodie Page
import DealSection from './Components/DealSection';

import ProductShow from './Components/ProductShow';
import Newletter from './Components/Newletter';
import Footer from './Components/Footer';
import TShirt from './Components/T-Shirt-Product/T-Shirt'; // T-Shirt Page

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Navigation />
        <Routes>
          {/* Default route for the home page */}
          <Route
            path="/"
            element={
              <>

                <ProductAPI /> {/* Hoodie Page */}

                {/* <DealSection /> */}

                <ProductShow />
                <Newletter />
              </>
            }
          />
          {/* Route for the T-Shirt component */}
          <Route path="/t-shirt" element={<TShirt />} />
          <Route path="/hoodie" element={<ProductAPI />} />
          {/* Add other routes here */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
